import { Component } from '@angular/core';
import type { AverageAgeByBloodType, Donator, ImcAverage, ObesityPercent, PossibleDonors } from 'src/app/core/@types/donator';
import { mock } from 'src/app/data/mock';
import { DashboardService } from './dashboard.service';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css'],
})
export class DashboardComponent {
  data: Donator[] = [];
  dataCopy: Donator[] = [];

  dataState: { [key: string]: number } = {};
  dataImcAverage: ImcAverage[] = [];
  dataObesityPercent: ObesityPercent[] = [];
  dataAverageAgeByBloodType: AverageAgeByBloodType[] = [];
  dataPossibleDonors: PossibleDonors[] = [];

  constructor(private readonly dashboardService: DashboardService) { }

  ngOnInit() {
    // this.data = mock;
    this.getData();
  }

  getData() {
    this.dashboardService.getData().subscribe(data => {
      this.data = data;
      this.dataCopy = this.data;

      this.createStateCounterTable(this.data );
    });

    this.dashboardService.getDataImc().subscribe(data => {
      const newDta = data.sort((a,b) => {
        const valuea = +a.ageRange.split('-')[0].trim();
        const valueb = +b.ageRange.split('-')[0].trim();

        if(valuea > valueb) return 1;
        if(valuea < valueb) return -1;
        return 0;
      })

      this.dataImcAverage = newDta;
    });

    this.dashboardService.getObesityPercent().subscribe(data => {
      this.dataObesityPercent = data;
    })

    this.dashboardService.getAverageAgeByBloodtype().subscribe(data => {
      this.dataAverageAgeByBloodType = data;
    })

    this.dashboardService.getPossibleDonors().subscribe(data => {
      this.dataPossibleDonors = data;
      console.log(this.dataAverageAgeByBloodType);
    });
  }

  createStateCounterTable(data: Donator[]) {
    // instancio chave estado com valor 0 com base na lista de candidatos
    this.data.map((donator) => (this.dataState[donator.address.state] = 0));

    // realiza somatoria de canditados em cada estado
    this.data.map((donator) => this.dataState[donator.address.state]++);
  }
}
<main class="dashboard-container">
  <header class="project-name">
    <h1>vital web app</h1>
    <h2>
      desenvolvido por
      <a
        href="https://github.com/pedrofavarao"
        target="_blank"
        title="github.com/pedrofavarao"
        >pedro favarao</a
      >
    </h2>
  </header>

  <section class="content">
    <div class="data-table">
      <table border="1">
        <thead>
          <tr>
            <th>id</th>
            <th>nome</th>
            <th>sobrenome</th>
            <th>genero</th>
            <th>idade</th>
            <th>peso</th>
            <th>altura</th>
            <th>imc</th>
            <th>cidade</th>
            <th>estado</th>
            <th>tipo sanguineo</th>
          </tr>
        </thead>

        <tbody>
          <tr *ngFor="let donator of this.data">
            <td id="id">{{ this.donator.id }}</td>
            <td id="firstName">{{ this.donator.firstName }}</td>
            <td id="lastName">{{ this.donator.lastName }}</td>
            <td id="gender">{{ this.donator.gender }}</td>
            <td id="age">{{ this.donator.age }}</td>
            <td id="weight">{{ this.donator.weight }} kg</td>
            <td id="height">{{ this.donator.height }} cm</td>
            <td id="imc">{{ this.donator.imc }}</td>
            <td id="city">{{ this.donator.address.city }}</td>
            <td id="state">{{ this.donator.address.state }}</td>
            <td id="bloodType">{{ this.donator.bloodType }}</td>
          </tr>
        </tbody>
      </table>
    </div>

    <div class="mult-table">
      <div class="data-table">
        <table border="1">
          <thead>
            <tr>
              <th>estado</th>
              <th>quantidade de cantidatos</th>
            </tr>
          </thead>

          <tbody>
            <tr *ngFor="let state of this.dataState | keyvalue">
              <td id="state">{{ state.key }}</td>
              <td id="donators">{{ state.value }}</td>
            </tr>
          </tbody>
        </table>
      </div>

      <div class="data-table">
        <table border="1">
          <thead>
            <tr>
              <th>faixa etaria</th>
              <th>imc medio</th>
            </tr>
          </thead>

          <tbody>
            <tr *ngFor="let imc of this.dataImcAverage">
              <td>{{this.imc.ageRange}}</td>
              <td>{{this.imc.averageIMC}}</td>
            </tr>
          </tbody>
        </table>
      </div>

      <div class="data-table">
        <table border="1">
          <thead>
            <tr>
              <th>genero</th>
              <th>percentual</th>
            </tr>
          </thead>

          <tbody>
            <tr *ngFor="let percent of this.dataObesityPercent">
              <td>{{this.percent.gender.toLowerCase() == 'm'? 'homens' : 'mulheres'}}</td>
              <td>{{this.percent.percentage}}</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>

    <div class="mult-table">
      <div class="data-table">
        <table border="1">
          <thead>
            <tr>
              <th>tipo</th>
              <th>media idade</th>
            </tr>
          </thead>

          <tbody>
            <tr *ngFor="let avg of this.dataAverageAgeByBloodType">
              <td>{{avg.bloodType}}</td>
              <td>{{avg.averageAge}}</td>
            </tr>
          </tbody>
        </table>
      </div>

      <div class="data-table">
        <table border="1">
          <thead>
            <tr>
              <th>tipo</th>
              <th>quantidade possiveis doadores</th>
            </tr>
          </thead>

          <tbody>
            <tr>
              <td>ab+</td>
              <td>6</td>
            </tr>
          </tbody>
